# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.Forms.Field~Subclass
    - djgeojson
    - Member[fields].Member[GeoJSONFormField]
  - - Django.Forms.Field~Subclass
    - djgeojson
    - Member[fields].Member[JSONField]
  - - Django.Forms.Field~Subclass
    - djgeojson
    - Member[fields].Member[JSONFormField]
